import Card from './Card';

export default function Cards(props) {
   return (
      <div>
         {props.characters.map((pj) => (
            <Card
            
               name={pj.name}
               species={pj.species}
               onClose={() => window.alert("Emulacion")}
               gender={pj.gender}
               status={pj.status}
               image={pj.image}
               origin={pj.origin.name}
            />
         ))}
      </div>
   );
}
